import { Text } from './Section.styled';
import FeedbackOptions from './FeedbackOptions/FeedbackOptions';

const Section = ({ title, options, onLeaveFeedback }) => {
	return (
		<>
			<Text>{title}</Text>
			<FeedbackOptions
				options={options}
				onLeaveFeedback={onLeaveFeedback}
			/>
		</>

	)
}

export default Section;
